import Head from 'next/head';

import { Button } from 'reactstrap';


function Home() {
  return (
    <>
    <Head>
      <title>Home - Luciano </title>
      <meta name="description" content="Site de ... sobre ..." />
      <meta name="author" content="Luciano Valente" />
    </Head>

    <Button color="success">success</Button>
    </>
  );
}

export default Home;
